using System;
using System.Collections.Generic;
using UnityEditor;
using UnityEngine;
using StorageHelper = Borodar.RainbowFolders.TexturesStorageHelper<Borodar.RainbowFolders.ProjectEditorTexture>;

namespace Borodar.RainbowFolders
{
    public static class ProjectEditorTexturesStorage
    {
        private static readonly Dictionary<ProjectEditorTexture, Texture2D> EDITOR_TEXTURES;
        private static readonly Dictionary<ProjectEditorTexture, Lazy<string>> EDITOR_STRINGS;

        //---------------------------------------------------------------------
        // Ctors
        //---------------------------------------------------------------------

        static ProjectEditorTexturesStorage()
        {
            EDITOR_TEXTURES = new Dictionary<ProjectEditorTexture, Texture2D>();
            EDITOR_STRINGS = (EditorGUIUtility.isProSkin) ? GetDictPro() : GetDictFree();
        }

        //---------------------------------------------------------------------
        // Public
        //---------------------------------------------------------------------

        public static Texture2D GetTexture(ProjectEditorTexture type)
        {
            return StorageHelper.GetTexture(type, FilterMode.Bilinear, EDITOR_STRINGS, EDITOR_TEXTURES);
        }

        //---------------------------------------------------------------------
        // Helpers
        //---------------------------------------------------------------------

        private static Dictionary<ProjectEditorTexture, Lazy<string>> GetDictPro()
        {
            return new Dictionary<ProjectEditorTexture, Lazy<string>>()
            {
                {ProjectEditorTexture.IcnEditSmall,              new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnEditLarge,              new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnPreviewGradientPopup,   new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnPreviewGradientDrawer,  new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutFirst,           new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutMiddle,          new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutLast,            new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutLevels,          new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFilter,                 new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnDelete,                 new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnSettings,               new Lazy<string>(()=> "")},
            };
        }

        private static Dictionary<ProjectEditorTexture, Lazy<string>> GetDictFree()
        {
            return new Dictionary<ProjectEditorTexture, Lazy<string>>()
            {
                {ProjectEditorTexture.IcnEditSmall,             new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnEditLarge,             new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnPreviewGradientPopup,  new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnPreviewGradientDrawer, new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutFirst,          new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutMiddle,         new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutLast,           new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFoldoutLevels,         new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnFilter,                new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnDelete,                new Lazy<string>(()=> "")},
                {ProjectEditorTexture.IcnSettings,              new Lazy<string>(()=> "")},
            };
        }
    }
}